import React from "react";


function Promocode (props) {


    return (

        <div className="cart-container__table__code">
            <h3>Have a promocode?</h3>
            <input type="text" />
            <button className="cart-container__table__code__button">Apply</button>
        </div>

    )
    }
    export default Promocode;
